import React from 'react';
import {SliderArrow} from '../slider_arrow/SliderArrow';


export const settings = {
    adaptiveHeight: true,
    swipeToSlide: true,
    prevArrow: <SliderArrow type='prev'/>,
    nextArrow: <SliderArrow type='next'/>,
};
